import { FaShoppingCart } from "react-icons/fa";
import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  const { cart } = useSelector((state) => state);

  return (
    <div className="allitem">
      <nav>
        <NavLink to="/home">
          <h3>Home</h3>
        </NavLink>

        <div>
          <NavLink to="/cart">
            <div>
              <FaShoppingCart />
              {cart.length > 0 && <span>{cart.length}</span>}
            </div>
          </NavLink>
        </div>

        <NavLink to="/register">
          <div>
            <h3>Sign Up</h3>
          </div>
        </NavLink>

        <NavLink to="/login">
          <div>
            <h3>Sign in</h3>
          </div>
        </NavLink>

        <NavLink to="/chatbot">
          <h3>
            <img src="/image/chatgpt.png" width="65rem" />
          </h3>
        </NavLink>
      </nav>
    </div>
  );
};

export default Navbar;

